import React from 'react';

function App (){
    const time = new Date().toLocaleTimeString();

    const update = () =>{
        time = new Date().toLocaleTimeString();
    }

    return(
        <>
            <div>
                <h1>Time {time}</h1>
                <button onClick={update}>Get Time</button>
            </div>
        </>
    );
}

export default App;
